import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";

const QuickSurvey = props => (
  <div className="bg-dark">
    <Container>
      <h3>Is there something in Spanish you'd like us to clarify? </h3>
    </Container>
  </div>
);

export default QuickSurvey;
